import React, {Component} from 'react';

class ZipRow extends Component {

    rowGen = ()=> {
	let rows = [];
	let enIndex = this.props.stIndex + this.props.numCols;
	for(let i=this.props.stIndex; i<enIndex; i++) {
	    rows.push(<td>{this.props.arr[i]}</td>);
	}
	return rows;
    }

    render(){
	return (
		<tr>{this.rowGen()}</tr>
	);
    }
}

export default ZipRow;
